import styled from 'styled-components';

export const FormBody = styled.div`
    background: #58c791;
    width: 100%;
    height: 100%;
    position: fixed;
`


export const FormContainer = styled.div`
    background: white;
    display: -webkit-flex;
    display: flex;
    height: 100%; 
    width: 100%;
`
